import React, {useState} from 'react'
import Tree from './Containers/Tree/Tree'
import {useSelector} from "react-redux"



const Layout = () => {
    const tree = useSelector(state => state.tree)

    return (

        <>
            <Tree items={tree}/>
        </>
    )
}

export default Layout
